import React from 'react';
import styles from './Studies1.module.css';

const Studies1 = () => (
  <div>
    <div>
      <h3>1. 생활코딩</h3>
      맨처음에 코딩을 배우기 위해서 시작한 강의, HTML, CSS, JS, Nodejs등의 기초를 배웠다.
    </div>
  </div>
);

export default Studies1;
